export default function Home() {

    const [ pokemons, setPokemons ] = useState();

        useEffect(()=>{
            axios.get("https://pokeapi.co/api/v2/pokemon/?limit=12").then(res => {
                setPokemons(res.data.results.map( poke => (
                    {
                        nome: poke.name,
                        url: poke.url,
                        votos: 0
                    }
                )))
            })
        }, [])



    return (
        <Body>  
            <Navbar/>
            <Movies/>
            <Characters/>
        </Body>
    );
};
